import React from "react";

import Playlist from "../Playlist";

import { Wrapper, Content } from "./Grid.styles.js";

const Grid = ({playlist}) => (
  <Wrapper>
    <Content>
      <Playlist playlist = {playlist}/>
    </Content>
  </Wrapper>
);

export default Grid;
